import React, { useState } from "react";
import "./Login.css"; // Reuse the same neumorphic styling

const PaymentPage = () => {
  const [cardName, setCardName] = useState("");
  const [cardNumber, setCardNumber] = useState("");
  const [expiry, setExpiry] = useState("");
  const [cvv, setCvv] = useState("");
  const [message, setMessage] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!cardName || !cardNumber || !expiry || !cvv) {
      setMessage("⚠️ Please fill in all payment details.");
      return;
    }
    setMessage("✅ Payment successful! Thank you for your purchase.");
  };

  return (
    <div
      className="login-container"
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "flex-start",
        gap: "80px", // adds spacing between cards
        marginTop: "40px",
      }}
    >
      {/* LEFT SIDE - PAYMENT CARD (unchanged size) */}
      <div
        className="login-card"
        style={{
          width: "600px",
          padding: "50px 40px",
          flexShrink: 0, // prevents resizing

        }}
      >
        <div className="login-header">
          <h2 style={{ fontSize: "1.5rem" }}>Payment Information</h2>
          <p>Please enter your card details below.</p>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label
              htmlFor="cardNumber"
              style={{
                display: "block",
                marginBottom: "8px",
                color: "#3d4468",
                fontWeight: "600",
                fontSize: "15px",
              }}
            >
              Name on Card
            </label>
            <div className="neu-input">
              <input
                type="text"
                id="cardName"
                placeholder=" "
                value={cardName}
                onChange={(e) => setCardName(e.target.value)}
              />
              <label htmlFor="cardName">Name on Card</label>
            </div>
          </div>

          <div className="form-group">
            <label
              htmlFor="cardNumber"
              style={{
                display: "block",
                marginBottom: "8px",
                color: "#3d4468",
                fontWeight: "600",
                fontSize: "15px",
              }}
            >
              Card Number
            </label>
            <div className="neu-input">
              <input
                type="text"
                id="cardNumber"
                placeholder=" "
                maxLength="19"
                value={cardNumber}
                onChange={(e) => setCardNumber(e.target.value)}
              />
              <label htmlFor="cardNumber">Card Number</label>
            </div>
          </div>

          <div className="form-group" style={{ display: "flex", gap: "16px" }}>
            <div style={{ flex: 1 }}>
              <label
                htmlFor="expiry"
                style={{
                  display: "block",
                  marginBottom: "8px",
                  color: "#3d4468",
                  fontWeight: "600",
                  fontSize: "15px",
                }}
              >
                Expiration
              </label>
            <div className="neu-input" style={{ flex: 1 }}>
              <input
                type="text"
                id="expiry"
                placeholder=" "
                maxLength="5"
                value={expiry}
                onChange={(e) => setExpiry(e.target.value)}
              />
              <label htmlFor="expiry">Expiration (MM/YY)</label>
              </div>
            </div>


            <div style={{ flex: 1 }}>
            <label
              htmlFor="cvv"
              style={{
                display: "block",
                marginBottom: "8px",
                color: "#3d4468",
                fontWeight: "600",
                fontSize: "15px",
              }}
            >
              CVV
            </label>
            <div className="neu-input" style={{ flex: 1 }}>
              <input
                type="password"
                id="cvv"
                placeholder=" "
                maxLength="4"
                value={cvv}
                onChange={(e) => setCvv(e.target.value)}
              />
              <label htmlFor="cvv">CVV</label>
            </div>
          </div>
          </div>

          <button type="submit" className="neu-button">
            <span className="btn-text">Pay Now</span>
          </button>

          {message && (
            <p
              style={{
                textAlign: "center",
                color: "#3d4468",
                marginTop: "12px",
                fontWeight: "500",
              }}
            >
              {message}
            </p>
          )}
        </form>
      </div>

      {/* RIGHT SIDE - FLIGHT INFORMATION CARD */}
      <div
        className="login-card"
        style={{
          width: "1000px", // make it bigger
          padding: "60px 80px",
          marginLeft: "4px", // move slightly right 
          background: "rgba(255, 255, 255, 0.7)",
        }}
      >
        <h3
          style={{
            color: "#3d4468",
            fontSize: "1.5rem",
            marginBottom: "16px",
            textAlign: "center",
          }}
        >
          Flight Information
        </h3>

        <div style={{ marginBottom: "20px" }}>
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              marginBottom: "10px",
            }}
          >
            <div>
              <p style={{ fontWeight: "600", color: "#3d4468" }}>
                Boston (BSTN) → Vermont (VRMNT)
              </p>
              <p style={{ fontSize: "14px", color: "#6c7293" }}>
                Departure: Nov 10, 2025 - 8:45 AM
              </p>
            </div>
            <p style={{ fontWeight: "600", color: "#3d4468" }}>$108.99</p>
          </div>

          <div
            style={{
              height: "2px",
              background:
                "linear-gradient(90deg, transparent, #bec3cf, transparent)",
              margin: "15px 0",
            }}
          ></div>

          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              fontWeight: "700",
              fontSize: "18px",
            }}
          >
            <p>Total</p>
            <p>$108.99</p>
          </div>
        </div>

        <div
          style={{
            display: "flex",
            justifyContent: "center",
            gap: "10px",
            marginTop: "20px",
          }}
        >
        </div>
      </div>
    </div>
  );
};

export default PaymentPage;
